import React, { Component } from 'react';
import { connect } from 'react-redux';



class ArtPage extends Component {
    // Renders the entire app on the DOM


    render() {
      console.log('this is a clear page with clear objectives');


        return (

           <div>
                <div></div>
                <button>Rented</button>
                <ul>
                   <li>{this.props.classes.cardText}>Kingdom: {p.kingdom}</li>
                   <li>{this.props.classes.cardText}>Clade: {p.clade}</li>
                   <li>{this.props.classes.cardText}>Order: {p.order}</li>
                   <li>{this.props.classes.cardText}>Family: {p.family}</li>
                   <li>{this.props.classes.cardText}>Subfamily: {p.subfamily}</li>
                   <li>{this.props.classes.cardText}>Genus: {p.genus}</li>
                </ul>
           </div>
        );
    }
}

const mapReduxStateToProps = (reduxState) => {
    return reduxState;
}


export default connect(mapReduxStateToProps)(ArtPage);
